import React, {useContext} from 'react';
import {Link} from "react-router-dom";
import { useAuth0 } from "@auth0/auth0-react";
import CustomButton from "../button/CustomButton"
import Profile from "../../Profile";
import LogoutButton from "../../LogOutButton";
import LoginButton from "../../LoginButton";


const Navbar = () => {

    const { user, isAuthenticated, isLoading } = useAuth0();

    if (isAuthenticated) {
        return (
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <a className="navbar-brand" href="/about">Default</a>
                <a className="navbar-brand" href="/about">Default</a>
                <a className="navbar-brand" href="/about">Default</a>
                <a className="navbar-brand" href="/about">Default</a>
                <Link to="/about">Homepage</Link>
                <Link to="/posts">Dashboard</Link>
                <Link to="/shelter">Shelters</Link>
                <Link to="/animal">Animals</Link>
            </nav>
            );
    } else {
        return (
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <a className="navbar-brand" href="/about">Homepage</a>
            </nav>
        );
    }
};

export default Navbar;
